INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES
('000b4673-f788-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 0,8кг Голубой', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 162, 61, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('030b5cff-f78e-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 1,9кг Бирюзовый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 94, 48, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('047805a5-fe8c-11e3-bbdb-005056be1f7b', 'Краска ВД акриловая д/стен и потолков (PROFESSIONAL) База С DALI 2,5л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 10, 9, 'КРАСКА ДАЛИ ДЛЯ СТЕН И ПОТОЛКОВ предназначена для декоративного и экологичного окрашивания стен и потолков внутри помещений с повышенной эксплуатационной нагрузкой. Применяется для окраски кирпичных, бетонных, оштукатуренных и других минеральных поверхностей.', 1),
('04834f06-93b0-11e3-82a4-005056be1f7b', 'Грунт-эмаль по ржавчине красный 2л  DALI', '569e2345-ff83-11e4-9228-005056be1f7a', 0, 68, 27, 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования коррозии и создает атмосферостойкое, водостойкое покрытие.', 1),
('05caaed0-f790-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 20кг Охра', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 8, 0, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('05caaed2-f790-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 20кг серый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 1, 1, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('06e98e75-f78f-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 6кг Шоколадный', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 16, 12, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('07027c6c-7f47-11e3-af7c-005056be1f7b', 'Краска латексная PARADE R7 база А шелк-мат. 5л Россия', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 39, 35, 'Шелковисто-матовая краска для стен и потолков любых типов помещений, в т.ч. с высокой эксплуатационной нагрузкой, требующих частой влажной уборки, а также фасадных элементов.\n', 1),
('076d2137-4380-11de-8f53-000e0c431b58', 'Грунт-эмаль по ржавчине черная 0,75л  DALI', '569e2345-ff83-11e4-9228-005056be1f7a', 0, 403, 80, 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования коррозии и создает атмосферостойкое, водостойкое покрытие.', 1),
