('079b44f8-f788-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 0,8кг Шоколадный', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 90, 59, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('0916172c-947c-11e3-8d88-005056be1f7b', 'Штукатурка структурная декоративная с эффектом "зернистости" размер "зерна" 2мм Белый 15кг', '6aa6af7c-ff83-11e4-9228-005056be1f7a', 0, 18, 18, 'Для декоративной отделки поверхностей внутри и снаружи помещений. Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии с равномерно зернистой структурой. Скрывает небольшие неровности основания. Легко наносится. Образуемый рельеф получается плавным и приятным на ощупь. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Размер зерна ~ 1,5 мм. Допускает мытье окрашенной поверхности.', 1),
('09f4768d-f78e-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 1,9кг Зеленый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 25, 48, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('0d8fcbcd-99a8-11db-937f-000e0c431b59', 'Грунт акриловый "PARADE" G30  4л', '569e2345-ff83-11e4-9228-005056be1f7a', 0, 167, 29, 'Грунтовка акриловая глубокого проникновения. Высококачественная готовая к употреблению грунтовка с высокой проникающей способностью и отличными связующими свойствами.', 1),
('0d8fcbcf-99a8-11db-937f-000e0c431b59', 'Грунт акриловый "PARADE" G30 10л', '569e2345-ff83-11e4-9228-005056be1f7a', 0, 102, 25, 'Грунтовка акриловая глубокого проникновения. Высококачественная готовая к употреблению грунтовка с высокой проникающей способностью и отличными связующими свойствами.', 1),
