('13cd2b5d-99a8-11db-937f-000e0c431b59', 'Шпатлевка акрил. "PARADE" S40 выравнивающая 1,5кг', '7eed2035-ff83-11e4-9228-005056be1f7a', 0, 446, 58, 'Рекомендуется для финишной отделки поверхностей под покраску и оклеивания обоев. Используется для шпатлевания деревянных, бетонных, кирпичных поверхностей. Образует белое ровное покрытие, устраняет мелкие дефекты основания.', 1),
('13cd2b61-99a8-11db-937f-000e0c431b59', 'Шпатлевка акрил. "PARADE" S41 финишная Супербелая 1,5кг', '7eed2035-ff83-11e4-9228-005056be1f7a', 0, 278, 56, 'Рекомендуется использовать для шпатлевания деревянных, бетонных, кирпичных поверхностей. Образует супербелое ровное покрытие. Великолепно подходит для финишной отделки поверхностей под покраску и оклеивания обоев.', 1),
('13cd2b63-99a8-11db-937f-000e0c431b59', 'Шпатлевка по дереву "PARADE" S50 Белый 0,4кг', '7eed2035-ff83-11e4-9228-005056be1f7a', 0, 450, 50, 'Рекомендуется для коррекции дефектов изделий из дерева. Обладает хорошим сцеплением, легко наноситься и прекрасно шлифуется. Подходит для стен и полов, для окон и паркета. Имитирует цвет древесины, образует гладкое, ровное покрытие.', 1),
