('500c0ee4-4f2c-11de-8f53-000e0c431b58', 'Огнебиозащитный состав ББ-11  (5л) (I и II гр.)', '569e2343-ff83-11e4-9228-005056be1f7a', 0, 69, 57, 'Предназначен: для профилактики и уничтожения дереворазрушающих, плесневых, окрашивающих грибов; профилактики появления насекомых;защиты от возгорания. Препарат представляет собой водный раствор на основе соединений бора. Прозрачная, бесцветная жидкость, без запаха, не изменяет текстуру и внешний вид обрабатываемой поверхности, не окрашивает древесины, экологически безопасен, не выделяет в окружающую среду вредных веществ, не повышает гидроскопичности древесины.\n', 1),
('500c0ee6-4f2c-11de-8f53-000e0c431b58', 'Огнебиозащитный состав ББ-11  (10л) (I и II гр.)', '569e2343-ff83-11e4-9228-005056be1f7a', 0, 135, 71, 'Предназначен: для профилактики и уничтожения дереворазрушающих, плесневых, окрашивающих грибов; профилактики появления насекомых;защиты от возгорания. Препарат представляет собой водный раствор на основе соединений бора. Прозрачная, бесцветная жидкость, без запаха, не изменяет текстуру и внешний вид обрабатываемой поверхности, не окрашивает древесины, экологически безопасен, не выделяет в окружающую среду вредных веществ, не повышает гидроскопичности древесины.\n', 1),
('55c10657-f78e-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 1,9кг черный', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 92, 57, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('56a6f723-ea03-11de-860d-000e0c431b58', 'Краска ВД акриловая д/обоев DALI 9л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 67, 37, 'Краска DALI акриловая для обоев обладает отличной адгезией к бумажным, флизелиновым и стеклообоям. Благодаря специально разработанному составу, краска DALI обладает хорошей укрывистостью и без проблем наносится на обои под покраску, сохраняя фактуру. Так же краска DALI может быть нанесена на минеральные поверхности, такие как гипсокартон, штукатурки, шпатлевки и тому подобные покрытия. Единственным условием к поверхности - нормальная влажность и температура в помещении, в котором производятся работы. Краска Dali содержит в составе специальные антибактериальные добавки, препятствующие образованию и размножению био организмов и бактерий. Кроме того краска DALI устойчива к влажной уборке и применению моющих средств, что делает стены и потолок помещения долговечными. Существуют две разновидности краски DALI - база А, подходящая и для машинной и для ручной колеровки, и база С, подходящая только для машинной колеровки. Купить и заколеровать краску DALI, а так же другую продукцию компании Рогнеда Вы можете в интернет магазине СтройБери, а так же в сети розничных магазинов.', 1),
('56f519d0-4f2c-11de-8f53-000e0c431b58', 'Краска ВД акриловая фасадная особопрочная База А DALI 9л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 240, 39, 'Применяется внутри и снаружи помещений по минеральным поверхностям (бетон, кирпич, гипс, цемент, гипсокартон, шпатлевка, штукатурка и др.) ', 1),
('58970c19-5a2d-11de-a649-000e0c431b58', 'Герметик "KRASS" сил. Универс. Коричневый   300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 209, 175, 'Обеспечивает отличное сцепление поверхностей из стекла, эмали, пластика, металла, керамике, дерева. Содержит противогрибковый компонент, препятствующий гниению, образованию плесени, грибков. Применяется в помещениях с повышенной влажностью.', 1),
('5ed5699a-f78e-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 1,9кг Красно-коричневый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 20, 46, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('5fde6d12-f789-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 6кг серебро', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 0, 0, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('612d8834-6137-11e1-96bd-005056be3bd8', 'Эмаль для радиаторов Лакра акриловая глянец. 0,9кг', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 153, 41, 'ЭМАЛЬ АКРИЛОВАЯ ДЛЯ РАДИАТОРОВ ОТОПЛЕНИЯ Высококачественная термостойкая водоразбавляемая эмаль на основе акриловой дисперсии. Для внутренних и наружных работ. Устойчива к высоким температурам (до 100°С), к пожелтению, к действию воды, атмосферных осадков и моющих средств. Быстро высыхает. Образует глянцевую поверхность высокой степени белизны. Обладает отличной укрывистостью и адгезией. Отличается высокими декоративными и защитными свойствами, стойкая к мытью. Готова к применению.', 1),
