('680965ab-f789-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 20кг Белая', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 18, 8, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('727c8145-f789-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 20кг Белый матовый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 17, 7, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('747ef690-551c-11dc-beb4-000e0c431b58', 'Эмаль ПФ-115 (Лакра) Бел. мат.  2кг', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 380, 104, 'Обладает хорошими декоративными свойствами и прочным сцеплением с окрашиваемой поверхностью. Эмаль легко наносится, образуя однородное гладкое покрытие, устойчивое к действию воды, атмосферных осадков и растворов моющих средств.', 1),
('763735c0-2a2b-11e2-9366-005056be3bd8', 'Грунт глубокого проникновения Tiefgrund  5л', 'fa733516-ff83-11e4-9228-005056be1f7a', 0, 348, 221, 'Идеально подходит для предварительной обработки очень пористых оснований с целью улучшения адгезии и укрепления поверхности перед укладкой керамической плитки, нанесением штукатурок, шпатлевок, наливных полов и стяжек, а так же перед покраской. Благодаря уникальной рецептуре грунтовка глубокого проникания Альмира обладает исключительной  проникающей способности идеальна для сильно впитывающих оснований.', 1),
('77c5eb9b-4b14-11e1-bd83-001cc494be80', 'Герметик "KRASS" по дереву Parquet ВЕНГЕ 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 164, 152, 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', 1),
('78e43dfb-fbee-11e1-8f72-005056be3bd8', 'Биосепт-УЛЬТРА антисептический состав  20л', '569e2343-ff83-11e4-9228-005056be1f7a', 0, 9, 0, 'Предназначен для усиленной длительной защиты конструкций и изделий из древесины от поражения плесенью, деревоокрашивающими, дереворазрушающими грибками и насекомыми. Применяется в особо тяжелых условиях: при непосредственном контакте с влажным грунтом, при интенсивном воздействии гигроскопической, конденсационной, атмосферной и почвенной влаги и т.п. Применяется как снаружи, так и внутри помещений, в том числе в особо тяжелых условиях, включая контакт с влажным грунтом', 1),
('7a3c5db1-777c-11de-9531-000e0c431b58', 'Краска ВД акриловая д/стен и потолков (PROFESSIONAL) База С DALI 9л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 1, 16, 9, 'КРАСКА ДАЛИ ДЛЯ СТЕН И ПОТОЛКОВ предназначена для декоративного и экологичного окрашивания стен и потолков внутри помещений с повышенной эксплуатационной нагрузкой. Применяется для окраски кирпичных, бетонных, оштукатуренных и других минеральных поверхностей.', 1),
('7a3c5db3-777c-11de-9531-000e0c431b58', 'Краска ВД акриловая д/стен и потолков (PROFESSIONAL) База С DALI 5л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 22, 24, 'КРАСКА ДАЛИ ДЛЯ СТЕН И ПОТОЛКОВ предназначена для декоративного и экологичного окрашивания стен и потолков внутри помещений с повышенной эксплуатационной нагрузкой. Применяется для окраски кирпичных, бетонных, оштукатуренных и других минеральных поверхностей.', 1),
('7a3c5db5-777c-11de-9531-000e0c431b58', 'Краска ВД акриловая фасадная особопрочная База С DALI 9л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 17, 11, 'Применяется внутри и снаружи помещений по минеральным поверхностям (бетон, кирпич, гипс, цемент, гипсокартон, шпатлевка, штукатурка и др.) ', 1),
('7a3c5db7-777c-11de-9531-000e0c431b58', 'Краска ВД акриловая фасадная особопрочная База С DALI 5л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 27, 18, 'Применяется внутри и снаружи помещений по минеральным поверхностям (бетон, кирпич, гипс, цемент, гипсокартон, шпатлевка, штукатурка и др.) ', 1),
('7ab6caa7-b1ee-11e0-aa21-000e0c431b58', 'Спецгрунт PARADE Reanimator G40  по ст. покрытиям 10л', '569e2345-ff83-11e4-9228-005056be1f7a', 0, 18, 12, 'Используется для грунтования различных видов поверхностей. Не требует механического удаления старых эмалевых покрытий. Обеспечивает прочное соединение основания и лакокрасочных материалов, выравнивает тон поверхности, улучшает впитывающие возможности поверхности, препятствует образованию коррозии. Образует полупрозрачное слегка шероховатое покрытие.', 1),
('7c1e70d5-5a9d-11dc-be42-000e0c431b58', 'Эмаль ПФ-115 (Лакра) Бел. мат.  1кг', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 261, 114, 'Обладает хорошими декоративными свойствами и прочным сцеплением с окрашиваемой поверхностью. Эмаль легко наносится, образуя однородное гладкое покрытие, устойчивое к действию воды, атмосферных осадков и растворов моющих средств.', 1),
('7e531df3-b5f5-11e1-83ba-005056be3bd8', 'Очиститель Cosmofen-20 1л прозр.', '72429777-ff83-11e4-9228-005056be1f7a', 0, 49, 30, 'Жидкое чистящее средство, не растворяющее поверхности. Применяется в качестве не размягчающего средства с антистатиком для очистки профилей из твердого ПХВ, профилей, кашированных пленкой из ренолита и профилей из полиуретана. Особенно пригоден для очистки от пыли, остатков клея с защитной пленки, жира, следов резины, свежей полиуретановой пены и свежих остатков размягченного ПВХ, а также следов шприцмашин для дегтя или битума. Применяемый антистатик эффективно предотвращает необходимость скорой повторной очистки от загрязнений поверхностей профиля и плит ПВХ.', 1),
('7ff8df4e-f789-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 20кг серебро', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 0, 0, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('82ebcce8-bce7-11e4-a1f3-005056be1f7b', 'Молотковая грунт-эмаль по ржавчине серебристая 10 л  DALI', '569e2345-ff83-11e4-9228-005056be1f7a', 0, 0, 0, 'Применяется по любым металлическим поверхностям: решетки, ограды, гаражи, различные металлоконструкции, автомобильные детали и др. внутри помещений и в условиях атмосферного воздействия.', 1),
('8522912f-f3fb-11e4-9746-005056be1f7b', 'Грунт-эмаль по ржавчине синяя 10л  DALI', '569e2345-ff83-11e4-9228-005056be1f7a', 0, 0, 0, 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования коррозии и создает атмосферостойкое, водостойкое покрытие.', 1),
('897bb5a6-b0fa-11e3-b34d-005056be1f7b', 'Растворитель для эмалей и красок', '72429777-ff83-11e4-9228-005056be1f7a', 0, 2, 25, 'Рекомендуется для разбавления финишных покрытий Parade Z1, Parade F50, Parade F51.Также применяется для разбавления эмалей и красок на основе эпоксидных, виниловых, акриловых, кремнийорганических полимеров, нитроцеллюлозы, хлоркаучука, меламино- и мочевиноформальдегидных материалов, для очистки инструмента после их нанесения и обезжиривания поверхности. Тип растворителя: специальный растворитель.', 1),
('89cb1aab-b1c3-11e0-aa21-000e0c431b58', 'Спецгрунт PARADE Reanimator G40  по ст. покрытиям  2,5л', '569e2345-ff83-11e4-9228-005056be1f7a', 0, 29, 23, 'Используется для грунтования различных видов поверхностей. Не требует механического удаления старых эмалевых покрытий. Обеспечивает прочное соединение основания и лакокрасочных материалов, выравнивает тон поверхности, улучшает впитывающие возможности поверхности, препятствует образованию коррозии. Образует полупрозрачное слегка шероховатое покрытие.', 1),
('9291c63a-5ab3-11dc-be42-000e0c431b58', 'Эмаль универсальная белая глянцевая 520 мл.', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 139, 61, 'Высококачественная алкидная эмаль предназначена для окраски предварительно загрунтованных металлических и деревянных поверхностей. Применяется для наружных и внутренних работ. Легко наносится на труднодоступные места, имеет хорошую укрывистость и атмосферостойкость, превосходную адгезию к окрашиваемой поверхности. \n', 1),
('9291c63c-5ab3-11dc-be42-000e0c431b58', 'Эмаль универсальная черная глянцевая 520 мл.', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 186, 61, 'Высококачественная алкидная эмаль предназначена для окраски предварительно загрунтованных металлических и деревянных поверхностей. Применяется для наружных и внутренних работ. Легко наносится на труднодоступные места, имеет хорошую укрывистость и атмосферостойкость, превосходную адгезию к окрашиваемой поверхности. \n', 1),
('9291c63e-5ab3-11dc-be42-000e0c431b58', 'Эмаль универсальная красная 520 мл.', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 119, 53, 'Высококачественная алкидная эмаль предназначена для окраски предварительно загрунтованных металлических и деревянных поверхностей. Применяется для наружных и внутренних работ. Легко наносится на труднодоступные места, имеет хорошую укрывистость и атмосферостойкость, превосходную адгезию к окрашиваемой поверхности. \n', 1),
('9291c640-5ab3-11dc-be42-000e0c431b58', 'Эмаль универсальная вишневая 520 мл.', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 75, 36, 'Высококачественная алкидная эмаль предназначена для окраски предварительно загрунтованных металлических и деревянных поверхностей. Применяется для наружных и внутренних работ. Легко наносится на труднодоступные места, имеет хорошую укрывистость и атмосферостойкость, превосходную адгезию к окрашиваемой поверхности. \n', 1),
('95aabdce-0d99-11dc-bdd4-000e0c431b58', 'Клей ПВА Мастер универсальный  0,9кг  ("Лакра")', '3df545ee-03aa-11e5-bad4-005056be1f7a', 0, 137, 66, 'Рекомендуется для склеивания изделий из дерева, не подвергающихся механическим нагрузкам, кожи, картона, бумаги и т.п.', 1),
('963b6b0a-04a8-11e3-94de-005056be3574', 'Штукатурка роллерная декоративная с эффектом "короеда" Белый 15кг', '6aa6af7c-ff83-11e4-9228-005056be1f7a', 0, 53, 18, 'Штукатурка фактурная ЛАКРА с эффект "короеда", готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии. Легко наносится валиком. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Допускает мытье окрашенной поверхности. Колеруется в светлые оттенки.', 1),
('992163db-a731-11de-90d4-000e0c431b58', 'Краска ВД акриловая д/потолков DALI 9л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 1, 85, 37, 'Предназначена для декоративного окрашивания потолков в сухих жилых и общественных помещениях с низкой эксплуатационной нагрузкой.', 1),
('992163dd-a731-11de-90d4-000e0c431b58', 'Краска ВД латексная д/кухни и ванной DALI 9л БАЗА А (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 60, 36, 'Латексная акриловая краска для декоративного окрашивания стен и потолков в жилых и общественных помещениях с повышенной влажностью воздуха и эксплуатационной нагрузкой. Применяется внутри помещений по минеральным поверхностям (бетон, кирпич, гипс, цемент, гипсокартон, шпатлевка, штукатурка и др.).', 1),
('993a4aa8-6b1e-11dc-be42-000e0c431b58', 'Краска акрил. "PARADE" W4 БАЗА А  Бел. мат. 9л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 993, 122, 'Parade W4 — краска акриловая для внутренних работ. Допускается частая влажная уборка с применением моющих средств, выдерживает более 3000 циклов мытья. Parade W4 применяется на стены и потолки помещений, подвергающиеся максимальным эксплуатационным нагрузкам (любые офисные и жилые помещения), подходит для окраски обоев.', 1),
('993a4aaa-6b1e-11dc-be42-000e0c431b58', 'Краска акрил. "PARADE" W4 БАЗА А  Бел. мат. 5л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 367, 56, 'Parade W4 — краска акриловая для внутренних работ. Допускается частая влажная уборка с применением моющих средств, выдерживает более 3000 циклов мытья. Parade W4 применяется на стены и потолки помещений, подвергающиеся максимальным эксплуатационным нагрузкам (любые офисные и жилые помещения), подходит для окраски обоев.', 1),
('993a4aac-6b1e-11dc-be42-000e0c431b58', 'Краска акрил. "PARADE" W4 БАЗА А  Бел. мат.  2,5л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 372, 68, 'Parade W4 — краска акриловая для внутренних работ. Допускается частая влажная уборка с применением моющих средств, выдерживает более 3000 циклов мытья. Parade W4 применяется на стены и потолки помещений, подвергающиеся максимальным эксплуатационным нагрузкам (любые офисные и жилые помещения), подходит для окраски обоев.', 1),
('993a4aae-6b1e-11dc-be42-000e0c431b58', 'Краска фасадная "PARADE" F20 Бел.мат. База  А 9л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 1443, 111, 'Акриловая краска Parade F20 предназначена для фасадных работ по бетонным, кирпичным, оштукатуренным и другим поверхностям. Супербелая, матовая, колеруется пастами для водных красок. Разбавляется водой. Хранить в оригинальной упаковке при температуре выше 0°C в течение 12 месяцев. Выпускается расфасованной в ведра по 2,5 л, 5 л и 10 л.', 1),
('9bd479ef-b369-11e4-a26a-005056be1f7b', 'Грунт БЕТОН-КОНТАКТ 20кг', 'fa733516-ff83-11e4-9228-005056be1f7a', 0, 53, 38, 'Предназначена для обработки гладких минеральных, преимущественно бетонных, вертикальных оснований перед нанесением цементно-песчаных и гипсовых штукатурок и шпаклевок, а так же плиточных клеев, в т.ч. торговой марки Ceresit, при внутренних работах.', 1),
('a0f3c4de-cf2d-11e1-92a4-005056be3bd8', 'Краска интерьерная "PARADE" W5 база А Бел. мат. 9л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 43, 19, 'Parade W5 интерьерная краска на акриловой основе, матовая для внутренних работ образует прочное матовое декоративное покрытие, выдерживающее частую влажную уборку с применением моющих средств. Рекомендуется для любых типов помещений при окраске стен и потолков, а также обоев под покраску.', 1),
('a1a9b4a6-f787-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 0,8кг Оранжевый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 122, 61, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('a48048ba-ec8c-11e3-9eab-005056be1f7b', 'Ксилол 0,5л', '72429777-ff83-11e4-9228-005056be1f7a', 0, 114, 29, 'Используется для разбавления до рабочей вязкости при нанесении краскораспылителем различных автоэмалей, а также некоторых лаков,красок,эмалей и грунтовок на алкидной (ПФ, ГФ) ,эпоксидной (ЭП) и битумной (БТ) основах.', 1),
('a663cb7c-fadf-11e3-b5e8-005056be1f7b', 'Краска латексная PARADE R7 база С шелк-мат. 2,5л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 16, 18, 'Шелковисто-матовая краска для стен и потолков любых типов помещений, в т.ч. с высокой эксплуатационной нагрузкой, требующих частой влажной уборки, а также фасадных элементов.\n', 1),
('a6f80c96-516a-11dd-a89a-000e0c431b58', 'Краска ВД акриловая д/обоев DALI 2,5л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 123, 49, 'Краска DALI акриловая для обоев обладает отличной адгезией к бумажным, флизелиновым и стеклообоям. Благодаря специально разработанному составу, краска DALI обладает хорошей укрывистостью и без проблем наносится на обои под покраску, сохраняя фактуру. Так же краска DALI может быть нанесена на минеральные поверхности, такие как гипсокартон, штукатурки, шпатлевки и тому подобные покрытия. Единственным условием к поверхности - нормальная влажность и температура в помещении, в котором производятся работы. Краска Dali содержит в составе специальные антибактериальные добавки, препятствующие образованию и размножению био организмов и бактерий. Кроме того краска DALI устойчива к влажной уборке и применению моющих средств, что делает стены и потолок помещения долговечными. Существуют две разновидности краски DALI - база А, подходящая и для машинной и для ручной колеровки, и база С, подходящая только для машинной колеровки. Купить и заколеровать краску DALI, а так же другую продукцию компании Рогнеда Вы можете в интернет магазине СтройБери, а так же в сети розничных магазинов.', 1),
('a6f80c98-516a-11dd-a89a-000e0c431b58', 'Краска ВД акриловая д/обоев DALI 5л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 71, 46, 'Краска DALI акриловая для обоев обладает отличной адгезией к бумажным, флизелиновым и стеклообоям. Благодаря специально разработанному составу, краска DALI обладает хорошей укрывистостью и без проблем наносится на обои под покраску, сохраняя фактуру. Так же краска DALI может быть нанесена на минеральные поверхности, такие как гипсокартон, штукатурки, шпатлевки и тому подобные покрытия. Единственным условием к поверхности - нормальная влажность и температура в помещении, в котором производятся работы. Краска Dali содержит в составе специальные антибактериальные добавки, препятствующие образованию и размножению био организмов и бактерий. Кроме того краска DALI устойчива к влажной уборке и применению моющих средств, что делает стены и потолок помещения долговечными. Существуют две разновидности краски DALI - база А, подходящая и для машинной и для ручной колеровки, и база С, подходящая только для машинной колеровки. Купить и заколеровать краску DALI, а так же другую продукцию компании Рогнеда Вы можете в интернет магазине СтройБери, а так же в сети розничных магазинов.', 1),
