('b7e28649-21de-11df-860d-000e0c431b58', 'Краска фактурная Белый 9 кг ("Лакра")', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 40, 27, 'Краска представляет собой белую вязкую однородную массу. Удобна в нанесении, легка в обработке, имеет высокую адгезию к основанию. После высыхания краска образует декоративное рельефное покрытие, скрывающие мелкие дефекты стен. Отличается высокой твердостью и атмосферостойкостью. Возможно последующее нанесение воднодисперсионной краски другого цвета на высохшее фактурное покрытие. Готова к применению.', 1),
