('b948502d-e1ad-11df-a0c5-000e0c431b58', 'Герметик "KRASS" битумный для крыш Черный 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 721, 178, 'Заполнение зазоров в крышах и кровли, ремонт битумных покрытий и гонтов, соединение аркушей рубероида, уплотнение при мелких кровельных работах, уплотнение в желобах и в спускных трубах, монтаж и крепление изоляционных материалов. \n', 1),
('ba1232df-ec8c-11e3-9eab-005056be1f7b', 'Растворитель Р-4 0,5л', '72429777-ff83-11e4-9228-005056be1f7a', 0, 447, 29, 'Представляет собой смеси летучих органических жидкостей. Растворитель Р-4 предназначен для разбавления лакокрасочных материалов на основе поливинилхлоридных хлорированных смол ПСХ ЛС и ПСХ ЛН, сополимеров винилхлорида, эпоксидных смол и других пленкообразующих веществ.', 1),
