('bf4804e2-fc0e-11dd-bd91-000e0c431b58', 'Краска акрил. "PARADE" W4 База С Бесцветный 2,5 л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 177, 34, 'Parade W4 — краска акриловая для внутренних работ. Допускается частая влажная уборка с применением моющих средств, выдерживает более 3000 циклов мытья. Parade W4 применяется на стены и потолки помещений, подвергающиеся максимальным эксплуатационным нагрузкам (любые офисные и жилые помещения), подходит для окраски обоев.', 1),
