('cb22e29d-68ed-11dd-b117-000e0c431b58', 'Биосепт-УЛЬТРА антисептический состав  10л', '569e2343-ff83-11e4-9228-005056be1f7a', 0, 92, 52, 'Предназначен для усиленной длительной защиты конструкций и изделий из древесины от поражения плесенью, деревоокрашивающими, дереворазрушающими грибками и насекомыми. Применяется в особо тяжелых условиях: при непосредственном контакте с влажным грунтом, при интенсивном воздействии гигроскопической, конденсационной, атмосферной и почвенной влаги и т.п. Применяется как снаружи, так и внутри помещений, в том числе в особо тяжелых условиях, включая контакт с влажным грунтом', 1),
