('cce7530f-27b6-11dd-942f-000e0c431b58', 'Огнебиозащитный состав КСД  (23кг)', '569e2343-ff83-11e4-9228-005056be1f7a', 0, 57, 23, 'Предназначен для комплексной защиты древесины, а также текстильных материалов. Состав защищает древесину от возгорания, распространения пламени, гниения, синевы, плесени а также поражения любыми видами биологических разрушителей внутри помещений, на открытом воздухе (под навесом).', 1),
