('ce813bcf-2257-11e1-ae36-001cc494be80', 'Краска ВД-АК 2180 "Новые технологии" интерьерная супербел. 1,3кг', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 260, 89, 'Краска акриловая для стен и потолков моющаяся предназначена для высококачественной окраски стен и потолков внутри бытовых и производственных помещений с повышенной эксплуатационной нагрузкой, требующих частой влажной уборки с применением моющих и дезинфицирующих средств.', 1),
