('cf6aa526-48b8-11dd-9342-000e0c431b58', 'Эмаль универсальная бронза 520 мл.', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 82, 48, 'Высококачественная алкидная эмаль предназначена для окраски предварительно загрунтованных металлических и деревянных поверхностей. Применяется для наружных и внутренних работ. Легко наносится на труднодоступные места, имеет хорошую укрывистость и атмосферостойкость, превосходную адгезию к окрашиваемой поверхности. \n', 1),
('d0659fe4-f787-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 0,8кг Зеленый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 150, 63, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('d1aa2ade-a3ef-11e1-ad4e-005056be3bd8', 'Очиститель Cosmofen-10 1л', '72429777-ff83-11e4-9228-005056be1f7a', 0, 40, 28, 'Очиститель нерастворяющий с антистатиком применяется для профессиональной чистки профелей из жесткого ПВХ, плат из вспененного твердого ПВХ, полиуретана и профелей кешированных ренолитной пленкой. Особенно хорош для очистки поверхности от пыли, остатков защитной пленки, жирных карандашей, следов резины, свежей полиуретановой пены и свежих остатков герметиков, таких как смола/битум. Оказывает хорошее действие на многие синтетические поверхности и в сочетании с антистатиком особенно хорош для выставочных и рекламных конструкций.', 1),
('d1eaa4c2-f78f-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 20кг Зеленый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 0, 0, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('d5823752-947b-11e3-8d88-005056be1f7b', 'Штукатурка фактурная декоративная с эффектом "шубы" Белый 15кг', '6aa6af7c-ff83-11e4-9228-005056be1f7a', 0, 19, 18, 'Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии. Образует на поверхности рельеф в виде «шубы». Скрывает небольшие неровности основания. Легко наносится валиком. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Допускает мытье окрашенной поверхности.', 1),
('d63bb09c-055c-11dd-b9c0-000e0c431b58', 'Краска фасадная "PARADE" F20  База  С Бесцветный 9л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 353, 29, 'Акриловая краска Parade F20 предназначена для фасадных работ по бетонным, кирпичным, оштукатуренным и другим поверхностям. Супербелая, матовая, колеруется пастами для водных красок. Разбавляется водой. Хранить в оригинальной упаковке при температуре выше 0°C в течение 12 месяцев. Выпускается расфасованной в ведра по 2,5 л, 5 л и 10 л.', 1),
