('e02ebd60-99a6-11db-937f-000e0c431b59', 'Клей ПВА "Люкс" мебельный 0,9кг ("Лакра")', '3df545ee-03aa-11e5-bad4-005056be1f7a', 0, 109, 69, 'Предназначен для профессионального применения в деревообрабатывающей и полиграфической промышленности, а также для ответственных видов работ в быту, в которых предъявляются высокие требования к прочности склейки. Рекомендуется для работ, где шов склеивания подвергается большим динамическим нагрузкам. Подходит для склеивания всех пород дерева, переплетных работ. Применяется при сборке и ремонте мебели, приклеивании шпона. ', 1),
