('e02ebd7a-99a6-11db-937f-000e0c431b59', 'Клей ПВА строительно-универсальный  4кг  ("Лакра")', '3df545ee-03aa-11e5-bad4-005056be1f7a', 0, 140, 40, 'Рекомендуется для следующих видов работ: приклеивания изделий из картона, бумаги, тканей, декоративной пленки (клеенки) на бумажной и полимерной основе, строительных элементов (серпянки и т.д.), подклейки бумажных обоев и т.п.', 1),
