('e02ebd7e-99a6-11db-937f-000e0c431b59', 'Клей ПВА строительно-универсальный 38кг  ("Лакра")', '3df545ee-03aa-11e5-bad4-005056be1f7a', 0, 0, 0, 'Рекомендуется для следующих видов работ: приклеивания изделий из картона, бумаги, тканей, декоративной пленки (клеенки) на бумажной и полимерной основе, строительных элементов (серпянки и т.д.), подклейки бумажных обоев и т.п.', 1),
('e02ebdc0-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" акриловый Белый  300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 691, 354, 'Для внутренних работ. Заделка трещин в бетоне, штукатурке, кирпичной кладке и древесине. Герметизация оконных и дверных коробок, подоконников, лестниц. Выравнивание небольших оштукатуренных поверхностей перед их покраской.', 1),
('e02ebdc3-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" для бетона и натурального камня Бесцветный 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 331, 156, 'Для внутренних и наружных строительных работ. Уплотнение трещин в бетоне , кирпиче, граните и других натуральных камнях и поверхностях при внутренних и наружных работах. Герметизация швов на фасаде зданий. Уплотнение стыков между стеной и подоконником. Облицовочные работы.', 1),
('e02ebdc6-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" для бетона и натурального камня Серый 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 154, 156, 'Для внутренних и наружных строительных работ. Уплотнение трещин в бетоне , кирпиче, граните и других натуральных камнях и поверхностях при внутренних и наружных работах. Герметизация швов на фасаде зданий. Уплотнение стыков между стеной и подоконником. Облицовочные работы.', 1),
('e02ebdcc-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" для каминов и печей Черный 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 303, 150, 'Герметизация швов, стыков в местах, подверженных действию высоких температур (до 1250°С). Уплотнение швов вокруг печей, дымоходов и каминов. Ремонт строительных элементов, подверженных действию огня. Стыки в вентиляционных каналах. ', 1),
('e12e57a9-f78f-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 20кг Синий', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 1, 1, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('e213c98a-ccbb-11e4-a1f9-005056be1f7b', 'Сольвент АЛТ 602/218 400 гр.', '72429777-ff83-11e4-9228-005056be1f7a', 0, 68, 48, 'Растворитель предназначен для разбавления лакокрасочных материалов и шпатлевок на основе: нитратоцелюлозных, нитратоцелюлозно-глифталевых, эпоксидных, нитратцелюлозно-эпоксидных, мочевино (меламино) формальдегидных, кремнеорганических (НЦ, ЭП, КО, МЧ, МС) и других лакокрасочных материалов.', 1),
('e242e97f-f29b-11dd-9439-000e0c431b58', 'Краска ВД акриловая фасадная всесезонная База А DALI 9л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 59, 21, 'КРАСКА ДАЛИ ФАСАДНАЯ ВСЕСЕЗОННАЯ DALI органорастворимая предназначена для высококачественной отделки фасадов при температуре воздуха до -20 С. Может применяться для ответственного окрашивания поверхностей на основе бетона, штукатурки, ДСП, ацеита, кирпича, пенобетона, дерева во всех климатических поясах, в том числе и в регионах со сложными атмосферными условиями. ', 1),
('e2e51024-e980-11e4-ab92-005056be1f7b', 'Краска латексная PARADE R20 база С П/мат 2,5л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 9, 0, 'Краска интерьерная латексная суперстойкая полуматовая. Высококачественная латексная интерьерная краска с исключительными показателями водостойкости, стойкости к мытью и мокрому истиранию.', 1),
('e39c5eb8-24d0-11e2-8158-005056be3bd8', 'Огнебиозащитный состав Корд 200кг', '569e2343-ff83-11e4-9228-005056be1f7a', 0, 0, 0, 'Предназначен для комплексной защиты древесины, а также текстильных материалов. Состав защищает древесину от возгорания, распространения пламени, гниения, синевы, плесени а также поражения любыми видами биологических разрушителей внутри помещений, на открытом воздухе (под навесом).', 1),
('e4020814-4598-11e1-8212-001cc494be80', 'Краска ВД латексная д/кухни и ванной DALI 9л БАЗА С (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 0, 0, 'Латексная акриловая краска для декоративного окрашивания стен и потолков в жилых и общественных помещениях с повышенной влажностью воздуха и эксплуатационной нагрузкой. Применяется внутри помещений по минеральным поверхностям (бетон, кирпич, гипс, цемент, гипсокартон, шпатлевка, штукатурка и др.).', 1),
('e545e44e-298d-11e2-8829-005056be3bd8', 'Огнебиозащитный состав Корд 23кг', '569e2343-ff83-11e4-9228-005056be1f7a', 0, 0, 0, 'Состав для огнезащитной обработки древесины и защиты древесины, находящейся в нормальных условиях эксплуатации  от биопоражений. Применяется внутри помещений и снаружи «под навесом» по новым или старым деревянным поверхностям и материалам на основе древесины (ДВП, ДСП, фанера др.)', 1),
('e545e450-298d-11e2-8829-005056be3bd8', 'Огнебиозащитный состав Корд 10кг', '569e2343-ff83-11e4-9228-005056be1f7a', 0, 0, 0, 'Состав для огнезащитной обработки древесины и защиты древесины, находящейся в нормальных условиях эксплуатации  от биопоражений. Применяется внутри помещений и снаружи «под навесом» по новым или старым деревянным поверхностям и материалам на основе древесины (ДВП, ДСП, фанера др.)', 1),
('e63d2bae-f78d-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 1,9кг Желтый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 89, 48, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('e68fd7da-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" для металла Бесцветный 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 1037, 162, 'Отличная адгезия к алюминию, железу, стали и другим металлическим поверхностям. Не вызывает коррозии у металлов (железо, сталь, алюминий, цинк). Шов не темнеет со временем, устойчив к деформации и нагрузкам. Водонепроницаем. Устойчив к атмосферным воздействиям и UV лучам.', 1),
('e68fd7dc-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" для металла Серый 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 1100, 162, 'Отличная адгезия к алюминию, железу, стали и другим металлическим поверхностям. Не вызывает коррозии у металлов (железо, сталь, алюминий, цинк). Шов не темнеет со временем, устойчив к деформации и нагрузкам. Водонепроницаем. Устойчив к атмосферным воздействиям и UV лучам.', 1),
('e68fd7df-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" по дереву Parquet БУК 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 182, 170, 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', 1),
('e68fd7e2-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" по дереву Parquet ДУБ 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 233, 170, 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', 1),
('e68fd7e4-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" по дереву Parquet ДУБ темный 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 280, 158, 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', 1),
('e68fd7e6-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" по дереву Parquet СОСНА 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 208, 170, 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', 1),
('e68fd7e9-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. Aqua-Silicon Бесцветный  300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 379, 176, 'Предназначен для герметизации и уплотнения аквариумов, склеивания витрин, стеклянных шкафов. Высокая эластичность шва. Является однокомпонентным, быстротвердеющим высокомодульным герметиком, который в реакции с атмосферной влагой образует эластичный, безусадочный, выдерживающий большие нагрузки, шов.', 1),
('e68fd7ec-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. Aqua-Silicon Черный  300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 290, 170, 'Предназначен для герметизации и уплотнения аквариумов, склеивания витрин, стеклянных шкафов. Высокая эластичность шва. Является однокомпонентным, быстротвердеющим высокомодульным герметиком, который в реакции с атмосферной влагой образует эластичный, безусадочный, выдерживающий большие нагрузки, шов.', 1),
('e68fd7ee-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. нейтрал. Белый   300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 204, 221, 'Незаменим для склеивания строительных материалов с гладкой и пористой поверхностью, металлов, бетона. Дает минимальную усадку. Превосходно склеивает поверхности в помещениях с высокой влажностью. Не обесцвечивает окрашенные поверхности. Рекомендуется строителями профессионалами.', 1),
('e68fd7f1-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. нейтрал. Бесцветный   300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 22, 209, 'Незаменим для склеивания строительных материалов с гладкой и пористой поверхностью, металлов, бетона. Дает минимальную усадку. Герметик силиконовый KRASS превосходно склеивает поверхности в помещениях с высокой влажностью. Не обесцвечивает окрашенные поверхности. Рекомендуется строителями профессионалами.', 1),
('e68fd7f3-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. САНИТАРНЫЙ Белый   300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 343, 344, 'Изготовлен на основе силикона и обладает сильным противогрибковым действием, препятствует появлению плесени, гнили и разного рода микроорганизмов. Он используется в условиях повышенной влажности (ванные комнаты, бани и т.д.), в канализационных и водоподающих сетях. Подходит для остеклительных работ и обработки подвижных/неподвижных швов снаружи и внутри зданий.', 1),
('e68fd7f5-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. САНИТАРНЫЙ Бесцветный  300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 391, 344, 'Изготовлен на основе силикона и обладает сильным противогрибковым действием, препятствует появлению плесени, гнили и разного рода микроорганизмов. Он используется в условиях повышенной влажности (ванные комнаты, бани и т.д.), в канализационных и водоподающих сетях. Подходит для остеклительных работ и обработки подвижных/неподвижных швов снаружи и внутри зданий.', 1),
('e68fd7fa-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. Универс. Белый   300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 803, 372, 'Обеспечивает отличное сцепление поверхностей из стекла, эмали, пластика, металла, керамике, дерева. Содержит противогрибковый компонент, препятствующий гниению, образованию плесени, грибков. Применяется в помещениях с повышенной влажностью.', 1),
('e68fd7fc-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. Универс. Бесцветный  300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', 0, 1784, 384, 'Обеспечивает отличное сцепление поверхностей из стекла, эмали, пластика, металла, керамике, дерева. Содержит противогрибковый компонент, препятствующий гниению, образованию плесени, грибков. Применяется в помещениях с повышенной влажностью.', 1),
('e755f307-f787-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 0,8кг Синий', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 118, 63, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
