('e8976171-93af-11e3-82a4-005056be1f7b', 'Грунт-эмаль по ржавчине жёлтый 2л  DALI', '569e2345-ff83-11e4-9228-005056be1f7a', 0, 179, 30, 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования коррозии и создает атмосферостойкое, водостойкое покрытие.', 1),
