('ebcc7a29-f78e-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 6кг Светло-зеленый', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 31, 12, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('ece048eb-fbaf-11e0-b702-001cc494be80', 'Краска ВД-АК "Водоэмульсионка.рф" интерьер. супербел. 6кг', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 0, 55, 'Краска акриловая потолочная предназначена для выполнения высококачественной окраски потолков внутри помещений с нормальной влажностью: Гостиные комнаты, спальни, детские комнаты, а также общественные и производственные помещения. Краска обладает идеальной белизной. Легко наносится на поверхность потолка без подтеков, брызг и разводов. Быстро сохнет. После нанесения образует ровную матовую поверхность. Скрывает микронеровности потолка. «Дышащее покрытие». Не желтеет. Не мелит. Без запаха. Гипоаллергенная. Устойчива к сухой уборке. Морозостойкая.', 1),
