('ece048f0-fbaf-11e0-b702-001cc494be80', 'Краска ВД-АК "Водоэмульсионка.рф" фасад. супербел. 6кг', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 2, 66, 'Краска акриловая фасадная предназначена для высококачественной окраски фасадов зданий и сооружений, а также для окраски стен и потолков внутри помещений. Краска обладает повышенной износостойкостью, влагостойкостью и атмосферостойкостью. Краску можно наносить на бетонные, кирпичные, заштукатуренные, зашпатлеванные и прочие минеральные поверхности, а также на гипсокартон, дерево, двп, дсп и обои под покраску.\n', 1),
