('f1be6b3a-f081-11df-a0c5-000e0c431b58', 'Эмаль ПФ-115 (Лакра) Сиреневая  1кг', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 110, 56, 'Обладает хорошими декоративными свойствами и прочным сцеплением с окрашиваемой поверхностью. Эмаль легко наносится, образуя однородное гладкое покрытие, устойчивое к действию воды, атмосферных осадков и растворов моющих средств.', 1),
('f1be6b3c-f081-11df-a0c5-000e0c431b58', 'Эмаль ПФ-115 (Лакра) Сиреневая  2кг', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 95, 48, 'Обладает хорошими декоративными свойствами и прочным сцеплением с окрашиваемой поверхностью. Эмаль легко наносится, образуя однородное гладкое покрытие, устойчивое к действию воды, атмосферных осадков и растворов моющих средств.', 1),
('f31a0079-f78e-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 6кг Синий', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 10, 12, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
