('f5ec168e-f78d-11e3-8c8a-005056be1f7b', 'Эмаль ПФ-115 Inter 1,9кг Красный', '6ecba52d-fe13-11e4-9228-005056be1f7a', 0, 131, 47, 'Высококачественная эмаль на основе алкидного лака предназначена для окраски деревянных и загрунтованных металлических поверхностей, подвергающихся атмосферным воздействиям, а также для внутренних отделочных работ. ', 1),
('f5f1fcd6-d1c2-11e3-8b7a-005056be1f7b', 'Штукатурка структурная декоративная с эффектом "зернистости" размер "зерна" 1,5мм Белый 15кг', '6aa6af7c-ff83-11e4-9228-005056be1f7a', 0, 53, 0, 'Для декоративной отделки поверхностей внутри и снаружи помещений. Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии с равномерно зернистой структурой. Скрывает небольшие неровности основания. Легко наносится. Образуемый рельеф получается плавным и приятным на ощупь. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Размер зерна ~ 1,5 мм. Допускает мытье окрашенной поверхности.', 1),
('f63c664a-52ee-11dd-a89a-000e0c431b58', 'Краска акрил. "PARADE" W4 База С Бесцветный 9л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 130, 32, 'Parade W4 — краска акриловая для внутренних работ. Допускается частая влажная уборка с применением моющих средств, выдерживает более 3000 циклов мытья. Parade W4 применяется на стены и потолки помещений, подвергающиеся максимальным эксплуатационным нагрузкам (любые офисные и жилые помещения), подходит для окраски обоев.', 1),
('fa74499c-7f46-11e3-af7c-005056be1f7b', 'Краска латексная PARADE R7 база А шелк-мат. 2,5л Россия', '7ab9d88b-fe13-11e4-9228-005056be1f7a', 0, 56, 51, 'Шелковисто-матовая краска для стен и потолков любых типов помещений, в т.ч. с высокой эксплуатационной нагрузкой, требующих частой влажной уборки, а также фасадных элементов.\n', 1),
